import React from 'react';

function CertificationCourses() {
    const certifications = [
        {
            name: "AWS Certified Solutions Architect",
            description: "Learn to design and deploy scalable systems on Amazon Web Services.",
            link: "https://aws.amazon.com/certification/certified-solutions-architect-associate/",
            logo: "https://i0.wp.com/amach.com/wp-content/uploads/2023/10/aww-logo-blue-background.png?resize=1024%2C1024&ssl=1g"
        },
        {
            name: "Google Professional Cloud Architect",
            description: "Master the skills to design and implement solutions on Google Cloud.",
            link: "https://cloud.google.com/certification/cloud-architect",
            logo: "https://images.credly.com/images/44994cda-b5b0-44cb-9a6d-d29b57163073/image.png"
        },
        {
            name: "Microsoft Azure Solutions Architect Expert",
            description: "Become proficient in deploying and managing solutions on Azure.",
            link: "https://learn.microsoft.com/en-us/certifications/azure-solutions-architect/",
            logo: "https://markpatton.cloud/wp-content/uploads/2020/02/azure-solutions-architect-expert-600x600-1.png"
        },
        {
            name: "Certified Kubernetes Administrator (CKA)",
            description: "Validate your skills in managing Kubernetes clusters and deployments.",
            link: "https://www.cncf.io/certification/cka/",
            logo: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSHDbufcpfxiGjBZDEIEP-NlXz9O24wKly7-jTYHVZtdwZthtpHQymLEtr5FiWb8Eq1E6A&usqp=CAU"
        },
        {
            name: "Cisco Certified Network Associate (CCNA)",
            description: "Foundational certification for networking professionals.",
            link: "https://www.cisco.com/c/en/us/training-events/training-certifications/certifications/ccna.html",
            logo: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcROABbAkVffH8rXqDGWsJVOmaO6CDEcsTGkDui_mHupe9ta8lgymAbrtJEyi0UlqI-0emI&usqp=CAUg"
        },
        {
            name: "CompTIA Security+",
            description: "Global certification for IT security and risk management.",
            link: "https://www.comptia.org/certifications/security",
            logo: "https://infocerts.com/wp-content/uploads/2023/04/CompTIA_security-plus-logoSITE.jpg"
        },
        {
            name: "Certified Ethical Hacker (CEH)",
            description: "Learn ethical hacking practices to secure systems and networks.",
            link: "https://www.eccouncil.org/programs/certified-ethical-hacker-ceh/",
            logo: "https://trainingcamp.com/wp-content/uploads/2023/11/CEH-Featured-Image.jpg"
        },
        {
            name: "PMP: Project Management Professional",
            description: "The gold standard for project management certifications.",
            link: "https://www.pmi.org/certifications/project-management-pmp",
            logo: "https://images.credly.com/images/731e7ef4-9b0c-4d7b-ab65-23cc699c0aa3/blob"
        },
        {
            name: "ITIL 4 Foundation Certification",
            description: "Learn IT service management best practices.",
            link: "https://www.axelos.com/certifications/itil-4-foundation",
            logo: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTGLN5YI1tvaNUxqzyhHPWfZntigfAJHvLRiUuDYh7sAwda6aYjoGA86oOhLAqzgvWJSW8&usqp=CAU"
        },
        {
            name: "Certified ScrumMaster (CSM)",
            description: "Understand the Scrum framework and improve team performance.",
            link: "https://www.scrumalliance.org/get-certified/scrum-master-track/certified-scrummaster",
            logo: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTfO-31RC3hIVNLBMEmQZ42L5n6YW2W2jpE0Q&s"
        },
        {
            name: "Oracle Certified Professional, Java SE 11 Developer",
            description: "Become a certified expert in Java programming.",
            link: "https://education.oracle.com/java-se-11-developer/trackp_815",
            logo: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ1sRMFBjtiSyf6tP4mVJ9GE5hsrFFx1iSOXIQBiSs70VUiUdjLjhByiI3z3TRfDeHn8C0&usqp=CAU"
        },
        {
            name: "Red Hat Certified Engineer (RHCE)",
            description: "Prove your skills in Red Hat Enterprise Linux system administration.",
            link: "https://www.redhat.com/en/services/certification/rhce",
            logo: "https://upload.wikimedia.org/wikipedia/commons/5/5e/Red_Hat_logo.svg"
        }
    ];

    return (
        <div style={{ padding: '20px' }}>
            <h1 style={{ textAlign: 'center', marginBottom: '20px' }}> Global Certifications</h1>
            <p style={{ textAlign: 'center', fontSize: '16px', marginBottom: '30px' }}>
                Enhance your skills and advance your career with these globally recognized certifications.
            </p>
            <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px', justifyContent: 'center' }}>
                {certifications.map((cert, index) => (
                    <div
                        key={index}
                        style={{
                            border: '1px solid #ddd',
                            borderRadius: '10px',
                            width: '300px',
                            boxShadow: '0 2px 6px rgba(0, 0, 0, 0.15)',
                            textAlign: 'center',
                            padding: '15px',
                            backgroundColor: '#fff'
                        }}
                    >
                        <img
                            src={cert.logo}
                            alt={`${cert.name} Logo`}
                            style={{ width: '100px', height: 'auto', marginBottom: '10px' }}
                        />
                        <h2 style={{ fontSize: '18px', margin: '10px 0' }}>{cert.name}</h2>
                        <p style={{ fontSize: '14px', margin: '10px 0', color: '#555' }}>{cert.description}</p>
                        <a
                            href={cert.link}
                            target="_blank"
                            rel="noopener noreferrer"
                            style={{
                                display: 'inline-block',
                                margin: '10px 5px',
                                padding: '8px 15px',
                                backgroundColor: '#007BFF',
                                color: '#fff',
                                borderRadius: '5px',
                                textDecoration: 'none',
                                fontWeight: 'bold'
                            }}
                        >
                            Learn More
                        </a>
                        <button
                            style={{
                                display: 'inline-block',
                                margin: '10px 5px',
                                padding: '8px 15px',
                                backgroundColor: '#28a745',
                                color: '#fff',
                                border: 'none',
                                borderRadius: '5px',
                                cursor: 'pointer',
                                fontWeight: 'bold'
                            }}
                            onClick={() => alert(`Applied for ${cert.name}`)}
                        >
                            Apply
                        </button>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default CertificationCourses;
